class ToxicityDataset(Dataset):
  def __init__(self, toxic_df, nontox_df, sentsTox, sentsNotTox, tokenizer, batch_size):
      
    self.tokenizer = tokenizer
    self.batch_size = batch_size
    self.texts = []
    self.labels = []
    for i,row in toxic_df.iterrows():
      text = row['Text']
      self.texts.append(text)
      self.labels.append(1)
    for i,row in nontox_df.iterrows():
      text = row['Text']
      self.texts.append(text)
      self.labels.append(0)
    
    # z = list(zip(self.texts, self.labels))
    # rand = random.sample(z, 10000)
    # self.texts, self.labels = zip(*rand)
    # self.texts = list(self.texts)
    # self.labels = list(self.labels)

    print('num ones', len(list(filter(lambda l: l == 1, self.labels))))
    print('num zero', len(list(filter(lambda l: l == 0, self.labels))))
    
    print('total', len(self.labels), len(self.texts))

  def __len__(self):
    return len(self.texts)

  def __getitem__(self, i):
    return self.texts[i], self.labels[i]

def generate_batch(batch):
  # texts = [tokenizer(entry[0]) for entry in batch]

  texts = [tokenizer.encode_plus(
        entry[0], add_special_tokens=True, truncation=True,
        max_length=128, padding='max_length',
        return_attention_mask=True) for entry in batch] #return_tensors='pt'

  inp_ids = [t['input_ids'] for t in texts]
  inp_ids = torch.LongTensor(inp_ids)
  attn_masks = [t['attention_mask'] for t in texts]
  attn_masks = torch.LongTensor(np.array(attn_masks))
  
  labels = torch.LongTensor([entry[1] for entry in batch])
  
  return inp_ids, attn_masks, labels

